import React, { Component } from "react";
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBIcon,} from 'mdbreact';

import { BrowserRouter as Router,Redirect } from "react-router-dom";
import Routes from "./Routes";

class App extends Component {
  state = {
    collapseID: "",
    redirect: true

  };

  toggleCollapse = collapseID => () =>
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));

  closeCollapse = collapseID => () => {
    window.scrollTo(0, 0);
    this.state.collapseID === collapseID && this.setState({ collapseID: "" });
  };


  render() {
    const container = { height: 1300 }
    const { redirect  } = this.state;

    return (
      <Router>
        <div className="flyout" style={{backgroundColor: "#fff",fontFamily:"Verdana, Geneva, Tahoma, sans-serif"}}>


          <MDBNavbar style={{paddingTop:"1px",paddingBottom: "1px",}}color="white" dark expand="md" fixed="top" scrolling>
            <MDBNavbarBrand href="/" style={{color:"black",paddingTop:"7px",paddingBottom: "7px",}}>
              <img src="https://kilaqitu.com/larsen/monproj/imageedit_1_4573485573.png" style={{ width: "3.7rem",marginRight:"12px",boxShadow:"rgb(249, 247, 247) 0px 1px 0px 0px, rgb(253, 251, 251) 0px 3px 0px 0px",borderRadius:"50%" }}/>LMG 

            </MDBNavbarBrand>

            <MDBNavbarToggler
            className="black" 
            icon="location-arrow"
              onClick={this.toggleCollapse("mainNavbarCollapse")}
            ><MDBIcon icon="ellipsis-v" /></MDBNavbarToggler>
            <MDBCollapse
              id="mainNavbarCollapse"
              isOpen={this.state.collapseID}
              navbar
              className="dark-grey-text"
            >
                <MDBNavbarNav left>
                  <MDBNavItem active>
                    <MDBNavLink    exact className="dark-grey-text" to="/">Home</MDBNavLink>
                  </MDBNavItem>

                  <MDBNavItem>
                    <MDBNavLink    exact className="dark-grey-text"  to="/pi">our services</MDBNavLink>
                  </MDBNavItem>

                  <MDBNavItem>
                    <MDBNavLink    exact className="dark-grey-text"  to="/pi">Gallery</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink exact className="dark-grey-text"  to="/geo">Past events</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink exact className="dark-grey-text"  to="/product">About</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink    exact className="dark-grey-text"  to="/pi">Get a quote</MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink    exact className="dark-grey-text"  to="/pi">Contact us</MDBNavLink>
                  </MDBNavItem>

                </MDBNavbarNav>
                <MDBNavbarNav right>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="facebook-f" /></MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="twitter" /></MDBNavLink>
                  </MDBNavItem>
                  <MDBNavItem>
                    <MDBNavLink to="#"><MDBIcon fab icon="instagram" /></MDBNavLink>
                  </MDBNavItem>
                </MDBNavbarNav>
              </MDBCollapse>
            </MDBNavbar>


        <div style={{ }}>
        <main >
        <Redirect to='/'/>
            <Routes />
          </main>
          </div>

        </div>
      </Router>
    );
  }
}

export default App;
